create table cs_question_bank
(
    cs_question_bank_id int auto_increment
        primary key,
    created_at          datetime(6)                                                          not null,
    updated_at          datetime(6)                                                          not null,
    cs_category         enum ('기타', '네트워크', '데이터베이스', '보안', '알고리즘', '운영체제', '자료구조', '컴퓨터구조') not null,
    cs_question         varchar(255)                                                         not null
);

